    return (
        <div className="grade_form">
            <div className="grade_title">Прогимназия</div>
            <div className="grade_number_form">
                {
                    junior.map(({grade})=>(
                        <div className="grade_number">
                            {grade}. клас
                        </div>

                    ))
                }
            </div>
        </div>
    );
};

HighSchool.propTypes = {

};

export default HighSchool;
